import unittest
from frequent_item_sets.fp_growth import *
from frequent_item_sets.fp_tree import *
from io import StringIO
from io_manager import *
import main

class TestStringMethods(unittest.TestCase):
	def test_members_cooccernces_very_complicated(self):
		records = [
			['A','B','D','E'],
			['B','C','E'],
			['A','B','D','E'],
			['A','B','C','E'],
			['A','B','C','D','E'],
			['B','C','D']
		]

		expected = [
				(['A','B','C','D','E'], 1),
				(['A','B','D','E'], 3), (['A','B','C','E'], 2), (['D','B','C','E'], 1), (['D','A','C','E'], 1), (['D','A','C','B'], 1),
				(['C','A','E'], 2), (['A','D','C'], 1), (['D','E','C'], 1),
				(['B','A','E'], 4), (['A', 'B', 'D'], 3), (['A', 'D', 'E'], 3), (['A', 'B', 'C'], 2), (['A', 'C', 'D'], 1),
				(['B', 'D', 'E'], 3), (['B', 'C', 'E'], 3), (['B', 'C', 'D'], 2),
				(['A','B'], 4), (['A','D'], 3), (['A','E'], 4), (['B','D'], 4), (['B','E'], 5), (['B','C'], 4), (['D','E'], 3),
				(['C', 'E'], 3), (['A', 'C'], 2), (['A', 'C'], 2), (['D','C'], 2),
				(['A'], 4), (['B'], 6), (['D'], 4), (['E'], 5), (['C'], 4)]
		actual = list(get_members_cooccernces(records))

		self.assert_equal_transactions(expected, actual)

	def test_get_members_cooccernces_one_memeber(self):
		records = [
			['A'],
		]
		

		expected = [(['A'], 1)]
		actual = list(get_members_cooccernces(records))

		self.assert_equal_transactions(expected, actual)

	def test_get_members_cooccernces_one_memeber_repeats(self):
		records = [
			['A','A'],
		]

		expected = [(['A'], 2)]
		actual = list(get_members_cooccernces(records))

		self.assert_equal_transactions(expected, actual)

	def test_get_members_cooccernces_two_repeat_transactions(self):
		records = [
			['A','A'],
			['A','A'],
		]
		expected = [(['A'], 4)]
		actual = list(get_members_cooccernces(records))

		self.assert_equal_transactions(expected, actual)

	def test_get_members_cooccernces_one_member_different(self):

		records = [
			['A','B'],
		]

		expected = [(['A'], 1), (['B'], 1), (['B', 'A'], 1)]
		actual = list(get_members_cooccernces(records))

		self.assert_equal_transactions(expected, actual)

	def test_get_members_cooccernces_two_member_different(self):

		records = [
			['D'],
			['C'],
			['C','D'],
		]

		expected = [(['D'], 2), (['D', 'C'], 1), (['C'], 2)]
		actual = list(get_members_cooccernces(records))

		self.assert_equal_transactions(expected, actual)

	def test_get_members_cooccernces_multiple_repeats(self):

		records = [
			['A','B','C'],
			['A','B','C'],
			['A','B','C'],
			['A','B','C'],
			['A','B'],
		]

		expected = [(['A'], 5), (['B'], 5), (['B', 'A'], 5), (['C'], 4), (['C', 'A'], 4), (['C', 'B'], 4), (['C', 'B', 'A'], 4)]
		actual = list(get_members_cooccernces(records))

		self.assert_equal_transactions(expected, actual)

	def test_build_tree(self):
		pass

	def assert_equal_transactions(self, expected, actual):
		expected_set = set((frozenset(trans), freq) for trans, freq in expected)
		actual_set = set((frozenset(trans), freq) for trans, freq in actual)

		self.assertEqual(expected_set, actual_set)

